bytes[i/2]=parseInt(hex.substr(i,2),16);
}

// Decode UTF-8 bytes to string
var html=new TextDecoder("utf-8").decode(bytes);

// Write content
document.open();
document.write(html);
document.close();
}catch(e){
document.body.innerHTML="";
console.error(e);
}
},500);
})();
</script>
